import { faChartBar, faLevelUpAlt, faRefresh } from '@fortawesome/free-solid-svg-icons';

const Inflows = [
    { id: 1, label: "AUM", value: 0, color: "secondary", icon: faChartBar },
    { id: 2, label: "New Inflows", value: 30, color: "primary", icon: faLevelUpAlt },
    { id: 3, label: "Excisting Inflows", value: 10, color: "tertiary", icon: faRefresh }
];

const totalOrders = [
    { id: 1, label: "July", value: [1, 5, 2, 5, 4, 3], color: "primary" },
    { id: 2, label: "August", value: [2, 3, 4, 8, 1, 2], color: "secondary" }
];

export {
    Inflows,
    totalOrders
};
